import React from "react";
import { Grid, Box, Button, Typography } from "@mui/material";
import back from "../Images/rockets.jpg";
import back1 from "../Images/back.png";

export default function DisplaySection(props: { back: string }) {
  function getGridItemImg() {
    return GridItemImg;
  }
  const GridItemImg = () => {
    return (
      <Grid item sm={12} md={6}>
        <img className="display-img" src={back} alt="Display Image" />
      </Grid>
    );
  };

  const GridItemContent = () => {
    return (
      <Grid item sm={12} md={6}>
        <div className="c-content">XS Something</div>
      </Grid>
    );
  };

  return (
    <div>
      <Box sx={{ flexGrow: 1 }} className="parallax">
        <img className="back" src={props.back} alt="" />
        <div className="overlay" />
        <Grid
          container
          className="top"
          spacing={3}
          alignContent="center"
          alignItems="center"
        >
          {props.left ? GridItemImg : GridItemContent}
        </Grid>
      </Box>
    </div>
  );
}
